commit_message:
Extended plugins sync: install, update and delete

Sync without any option now will allow to sync all plugins:
if it is already installed and exist in DB - update;
if it is already installed and not exist in filesystem - delete;
if it is already installed and not exist in DB - install.

Change-Id: Idd93c2ec29f8da5d1674bfc56324bbb28a70f215
